/**
 * Typed Arguments facilitating the differentiation
 * between different argument types due to Javascript's
 * single number type.
 *
 * @remark In Assemblyscript the latter are all native types
 */
export declare enum TypedArrayUnit {
    STRING = 0,
    BOOL = 1,
    U8 = 2,
    U32 = 3,
    U64 = 4,
    I32 = 5,
    I64 = 6,
    F32 = 7,
    F64 = 8
}
